import { jsTPS_Transaction } from "./jsTPS";

export default class EditSong_Transaction extends jsTPS_Transaction {
    constructor(store, title, artist, youTubeId) {
        super();
        this.store = store;
        this.title = title;
        this.artist = artist;
        this.youTubeId = youTubeId;

        this.prevTitle = null;
        this.prevArtist = null;
        this.prevYouTubeId = youTubeId;
    }

    doTransaction() {
        this.store.saveEditedSong(this.title,this.artist, this.youTubeId);
    }
    
    undoTransaction() {
        // this.app.editMarkedSong(this.prevInfo, this.currentSongNum);
    }
}
